import "./Error.css";

const Error = () => {
  return (
    <div className="error">
      <img
        src="https://img.freepik.com/free-vector/404-error-template-flat-style_23-2147759383.jpg"
        alt="error"
      />
    </div>
  )
};

export default Error;
